window.bookSummaryJSON = "<p><b>What is it that they say? Life's a witch, and then you die.</b></p> <p>Change and I have never been best friends, something that's only gotten clearer from my imprisonment at the Guild of Guardians. As punishment for stealing a magical object, I’ve got to hunt down criminal supernaturals to pay off my sentence.</p> <p>The men in my new team don’t want me around. Neither do the other inmates. They just want to push me to my limits, test me, thinking that I’ll fail. But they have another thing coming. I’m Astra Nomical. I'll pass everything they throw my way, prove I’m worthy, and I won't lose my heart along the way.</p> <p><b><i>Life's a Witch</i></b><b> is book one in the Guild of Guardians series, a supernatural prison reverse harem with enemies to lovers, plenty of action, swoon-worthy men, and a heroine determined to end up on top. For fans of </b><b><i>Buffy the Vampire Slayer</i></b><b> and Cassandra Clare's </b><b><i>Shadow Hunters</i></b><b>.</b></p>"; 
